import React from 'react'
import { useNavigate } from 'react-router-dom';

const Home = () => {

    const navigate = useNavigate();

    const menuClick = (e) => {
        e.preventDefault();
        navigate('menu');
    };
    return (
    <div>
        <button onClick={menuClick}>To menu</button>
    </div>
  )
}

export default Home
